import { useState } from 'react';
import * as S from '../styles/Header.style'

function Header() {

  return(
    <S.Header>
        <div>Header</div>
        <S.Link>
          <S.Menu as="a" href="/mainpage">Logs</S.Menu>
        </S.Link>
        <S.Link href="/routine" >
          <span>Routine</span>
          <S.Menu as="a" href="/routine">Routine</S.Menu>
        </S.Link>
        <S.Link href="/mypage" >
          <span>MyPage</span>
        </S.Link>
        <S.Link>Image</S.Link>
      </S.Header>
  );
};

export default Header;
